import React, { useEffect, useState, useRef } from 'react';

function App() {
  const [text, setText] = useState('');
  const fullText = "Hi, I'm Prachi Pawar | Software Engineer | Frontend Developer | HTML | CSS | Bootstrap | Figma | ReactJS | AngularJS | Python | Webflow";
  const index = useRef(0);

  useEffect(() => {
    const type = () => {
      if (index.current < fullText.length) {
        setText((prev) => prev + fullText.charAt(index.current));
        index.current++;
        setTimeout(type, 50);
      }
    };
    type();
  }, []);

  return (
    <div className="container">
      <h1 className="typewriter">{text}</h1>
      <div className="resume-link">
        <a href="https://drive.google.com/file/d/1xq2-jKaruUh2ZlLeP_B5pPeLXmM5Ixu6/view?usp=drivesdk" target="_blank" rel="noopener noreferrer">
          Download Resume
        </a>
      </div>
    </div>
  );
}

export default App;
